import React from 'react';
import { Provider } from 'react-redux';
import createStore from './createReduxStore'
import Buttons from './components/Buttons'

import './App.css';

const store = createStore()

function App() {
  return (
    <div className="App">
      <Provider store={store}>
        <Buttons/>
      </Provider>

    </div>
  );
}

export default App;
